import React, { BrowserRouter, } from 'react-router-dom';
import './App.scss';

const App = () => {
  return (
      <BrowserRouter>
      <Switch>
        <Route path="/" exact component={HomePage}/>
        <Route path="/movies/:movieId" component={HomePage}/>
      </Switch>
    </BrowserRouter>
  )
}

export default App;
